79c-a58a-4d8c636d0c6a'), ('79a4c2cc-10af-4ef2-85e8-031ec1b1d520', 'Pruebas del Admin', 'P', '2025-08-04', '97cd25f1-a921-49e7-b62f-2539880ad5b2', '16880bf1-3795-4fef-85bd-b6867a32b641', '1', '1', '1', '1', '1', '5', 'Baja Complejidad', '2025-08-04 22:55:03.711882+00', '2025-08-04 22:55:03.711882+00', '5413c98b-df84-41ec-bd77-5ea321bc6922'), ('9da4bdb3-7415-4817-94be-d24f47fedcbd', 'SR2049835', 'Solicito de su amable colaboración nos puedan apoyar con un cargue masivo de 1761 UD y 82459 TV en estado de DISPOSICION PARA ENTREGA a REUBICACION POR RECOLECCION, el cual se solicita debido a que la capacidad operativa se sobresale en este termino y el cliente esta necesitando carpetas de las que se encuentran en el préstamo, por lo cual solicitamos de su apoyo, adjunto encontrara las UD y TV a recepcionar con su respectiva caja contenedora.', '2025-07-24', '000c1ec0-2cc4-4edb-b5dd-9b56e2126ece', '6e371913-5870-41c1-9031-d311195a1121', '2', '2', '3', '2', '3', '12', 'Alta Complejidad', '2025-07-24 19:12:09.98296+00', '2025-07-28 14:07:36.934028+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a');


