025-07-18', null, 'SR2064814_RPT_CAMBIOTAMANO_v2.sql', '75795', '6e371913-5870-41c1-9031-d311195a1121', null, '2025-08-01 15:08:41.07817+00', '2025-08-01 15:12:55.626213+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', 'SR2064814'), ('50165552-5906-411a-b65c-96773cf27818', '2025-07-31', '9da4bdb3-7415-4817-94be-d24f47fedcbd', 'SR2049835_INS_FD_INVENTARIOV5.sql', '75941', '6e371913-5870-41c1-9031-d311195a1121', '"
Se modifico el orden de ingreso de los fondos documentales en el inventarios ya que se estaban ingresando en un orden errado y a veces el script ingresaba primero un fondo contenido y no primero su contenedor, generando error ORA-01403 o ORA-01422.

De acuerdo con esto se modifico el script para que ingrese los fondos en este orden:
CAJA (00) -> CARPETA (UD) -> TITULO VALOR (TV)

También se modifico las consultas SELECT INTO agregando la sentencia ROWNUM  = 1 para que solo se seleccione un registro a la hora de seleccionar códigos de inventario o de fondo contenedor.

Esta modificación se realiza con el fin de solicitar alcance al comité de control de cambios realizado el día 29/07/2025."', '2025-07-31 16:56:52.01354+00', '2025-08-01 14:51:44.913501+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', 'SR2049835'), ('555edbf1-07ad-4c1d-b25c-bc49231b7973', '2025-07-24', null, 'SR2064209_CORRECION_ESTADO.sql', '75863', '6e371913-5870-41c1-9031-d311195a1121', null, '2025-08-01 15:11:12.986592+00', '2025-08-01 15:12:59.844993+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', 'SR2064209'), ('5c703c65-0812-4ecc-95fb-7df2884b70b4', '2025-07-21', null, 'SR2064451_ELM_PROCESO_FIS.sql', '75809', '6e371913-5870-41c1-9031-d311195a1121', null, '2025-08-01 15:09:18.176013+00', '2025-08-01 15:12:40.248064+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', 'SR2064451'), ('69856207-bac6-4127-834b-229d9f65a772', '2025-07-22', null, 'SR2062407_ASIG_CLI_148406.sql', '75824', '6e371913-5870-41c1-9031-d311195a1121', null, '2025-08-01 15:09:48.269475+00', '2025-08-01 15:13:01.892941+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', 'SR2062407'), ('7ee5471a-2399-4aa0-9424-3212311811de', '2025-07-18', null, 'SR2052628_REPORTES_CLIENTES.sql', '75801', '6e371913-5870-41c1-9031-d311195a1121', 'Nueva versión', '2025-07-31 16:30:04.41142+00', '2025-08-01 15:05:32.536249+00', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', '079c1a87-1851-479c-a58a-4d8c636d0c6a', 'SR2052628'), ('9441ceb0-2c68-4dc2-9556-dc68a94819bc', '2025-08-05', '10b9829f-dbd0-498d-bb4f-4ff67a57a6d9', 'SR2071392_CAM_ESTADO_RECURRENTE.sql', '76000', '6e371913-5870-41c1-9031-d311195a1121', null, '2025-08-05 22:51:28.037819+00', '2025-08-05 22:51:28.037819+00', '5413c98b-df